import React from 'react';
import './JobseekerLogin.css'; // Optional: for styling

const JobseekerLogin = () => {
  return (
    <div className="login-container">
      <div className="login-card">
        <h2>Sign in as Jobseeker</h2>
        <p>Access your account to find your dream job</p>

        <div className="login-options">
          <button className="login-btn google">
            <img src="/google-icon.svg" alt="Google" />
            Continue with Google
          </button>

          <button className="login-btn microsoft">
            <img src="/microsoft-icon.svg" alt="Microsoft" />
            Continue with Microsoft
          </button>
        </div>

        <div className="register-link">
          New to JobPortal? <a href="/register">Create jobseeker account</a>
        </div>
      </div>
    </div>
  );
};

export default JobseekerLogin;
